import React from "react";

function Info() {
  const friends = ["Mars", "Jane", "Nick"];

  return (
    <div className="info">
      <p>Our friends is :</p>
      {friends.map((friend) => (
        <p>Mt friend is {friend}</p>
      ))}
    </div>
  );
}

export default Info;
